import{u as t}from"./composables.3e7751fd.js";import{o as e,I as s,X as i}from"./entry.4bed7bce.js";const o=""+new URL("mbr-13.4283ea09.jpg",import.meta.url).href,a=i('<section class="mbr-section content5 cid-sahJguGIDk" id="content5-6"><div class="mbr-overlay" style="opacity:0.4;background-color:rgb(35, 35, 35);"></div><div class="container"><div class="media-container-row"><div class="title col-12 col-md-8"><h2 class="align-center mbr-bold mbr-white pb-3 mbr-fonts-style display-1">Look fashionable always <div><br></div></h2><h3 class="mbr-section-subtitle align-center mbr-light mbr-white pb-3 mbr-fonts-style display-5"> We work with some of the best designers in the world to make sure you have the best fashion designs for low prices. Even high end designs are here for incredible prices. <div></div><div><br></div></h3></div></div></div></section><section class="mbr-section article content1 cid-sahJfEZqzm" id="content2-5"><div class="container"><div class="media-container-row"><div class="mbr-text col-12 col-md-8 mbr-fonts-style display-7"><blockquote><strong>Shopncute is a social platform as well. With an integrated chat system, blogging, sharing tools, and our built in designer. We provide the tools for you to connect with others across our site. </strong></blockquote><blockquote><strong> If you are a fashionista, then we want to hear from you. Here on Shopncute, we offer ways for people to voice their opinions via our blogging tool. Update others on the latest trends and even your own fashion designs. </strong></blockquote><blockquote><strong> With ShopnCute, you can use the built in Designer to make a statement before you buy. Simply use our designer to choose clothing from our store, choose your size, and start designing. </strong></blockquote></div></div></div></section><section class="counters4 counters cid-sahJnowRfN" id="counters4-7"><div class="container pt-4 mt-2"><h2 class="mbr-section-title pb-3 align-center mbr-fonts-style display-2">The Promise</h2><div class="media-container-row"><div class="media-block m-auto" style="width:49%;"><div class="mbr-figure"><img src="'+o+'" alt="" title=""></div></div><div class="cards-block"><div class="cards-container"><div class="card px-3 align-left col-12"><div class="panel-item p-4 d-flex align-items-start"><div class="card-img pr-3"><h3 class="img-text d-flex align-items-center justify-content-center"> 1 </h3></div><div class="card-text"><h4 class="mbr-content-title mbr-bold mbr-fonts-style display-7">For Girls and Women of all ages </h4><p class="mbr-content-text mbr-fonts-style display-7">Shopncute is a female oriented site, aimed to provide everything from clothing to electronics at reasonable prices. We believe that every woman should look and feel amazing. <br><br></p></div></div></div><div class="card px-3 align-left col-12"><div class="panel-item p-4 d-flex align-items-start"><div class="card-img pr-3"><h3 class="img-text d-flex align-items-center justify-content-center"> 2 </h3></div><div class="card-text"><h4 class="mbr-content-title mbr-bold mbr-fonts-style display-7">Everywhere you Are </h4><p class="mbr-content-text mbr-fonts-style display-7">We know that most of the world is on mobile, but not everyone is using the same device. Our apps are available on iOS, MacOS, FireOS, Tizen, Android, Windows, Blackberry, Linux, Smart TVs, SailfishOS, KaiOS, ChromeOS, and we support all major browsers. <br><br></p></div></div></div><div class="card px-3 align-left col-12"><div class="panel-item p-4 d-flex align-items-start"><div class="card-img pr-3"><h3 class="img-text d-flex align-items-center justify-content-center"> 3 </h3></div><div class="card-text"><h4 class="mbr-content-title mbr-bold mbr-fonts-style display-7">We Are Passionate</h4><p class="mbr-content-text mbr-fonts-style display-7">We are always here for you, rather its to answer questions, give fashion tips with our fashion blog, or anything else within ShopnCute. <br><br></p></div></div></div></div></div></div></div></section><section class="counters6 counters cid-sahJsE4V5o" id="counters6-8"><div class="container pt-4 mt-2"><h2 class="mbr-section-title pb-3 align-center mbr-fonts-style display-2">The Story of Numbers </h2><h3 class="mbr-section-subtitle pb-5 align-center mbr-fonts-style display-7">We are proud to launch Shopncute as a place where women of all ages can gather and talk about fashion. However, we also know that numbers are important so: <div><br></div></h3><div><div class="cards-container"><div class="card col-12 col-md-6 col-lg-4 pb-md-4"><div class="panel-item align-center"><div class="card-img pb-3"><h3 class="img-text mbr-fonts-style display-1">01.</h3></div><div class="card-text"><h4 class="mbr-content-title mbr-bold mbr-fonts-style display-7">Statistics</h4><p class="mbr-content-text mbr-fonts-style display-7">We provide statistics to everyone about what, when, and where something is selling best or least to help you with your buying needs. <br><br></p></div></div></div><div class="card col-12 col-md-6 col-lg-4 pb-md-4"><div class="panel-item align-center"><div class="card-img pb-3"><h3 class="img-text mbr-fonts-style display-1">02.</h3></div><div class="card-text"><h4 class="mbr-content-title mbr-bold mbr-fonts-style display-7">Blog Posts</h4><p class="mbr-content-text mbr-fonts-style display-7">We are active on social media and most importantly our blog posts on this site and Meeovi.com. We keep you inform on what is going on with Shopncute. <br><br></p></div></div></div><div class="card col-12 col-md-6 col-lg-4 last-child"><div class="panel-item align-center"><div class="card-img pb-3"><h3 class="img-text mbr-fonts-style display-1">03.</h3></div><div class="card-text"><h4 class="mbr-content-title mbr-bold mbr-fonts-style display-7">Make a Profit</h4><p class="mbr-content-text mbr-fonts-style display-7">Looking to sell, well our sister site <a href="https://meeovi.com" target="_blank">Meeovi.com</a> offers ways to sell your own fashion and other products at any price you want. <br><br></p></div></div></div></div></div></div></section><section class="mbr-section content4 cid-sahJx2RGCD" id="content4-9"><div class="container"><div class="media-container-row"><div class="title col-12 col-md-8"><h2 class="align-center pb-3 mbr-fonts-style display-2"> Our Blog</h2><h3 class="mbr-section-subtitle align-center mbr-light mbr-fonts-style display-5"> Follow the latest content from ShopnCute.</h3><div class="mbr-section-btn align-center py-4"><a class="btn btn-black display-4" href="/blog">LEARN MORE</a></div></div></div></div></section>',5),l=[a],n={},h=Object.assign(n,{__name:"about",setup(r){return t({title:"About Us"}),(c,d)=>(e(),s("div",null,l))}});export{h as default};
